import { createBrowserRouter } from "react-router-dom";
import App from "./App";

import AboutUs from "./components/Link/AboutUs";
import Register from "./components/Authenticate/Register";
import Login from "./components/Authenticate/Login";
import ReadAPI from "./components/APICRUD/Read";
import CreateAPI from "./components/APICRUD/Create";
import ViewAPI from "./components/APICRUD/View";
import UpdateAPI from "./components/APICRUD/Update";






const router = createBrowserRouter([
    { path: '', element: <App/> },
    { path: 'aboutus', element: <AboutUs/> },
    { path: 'register', element:<Register/>},
    { path: 'login', element:<Login/>},
    { path: 'readAPI', element:<ReadAPI/>},
    { path: 'createAPI', element:<CreateAPI/>},
    { path: 'viewAPI/:postId', element:<ViewAPI/>},
    { path: 'updateAPI/:postId/edit', element:<UpdateAPI/>},

]);

export default router;
